export default function CommonBanner(props) {
  return (
    <>
   <div className="site-banner">
    <div className="container">
        <div className="banner-head">
            <h1 className="banner-head-text text-center">{props.heading}</h1>
        </div>
    </div>
   </div>
   </>
  )
}
